webpackJsonp([0xe4723552b2f0],{5101:function(e,t){e.exports={data:{post:{html:"<p><b>Euro 2000 Semifinal: France 2 Portugal 1 in extra time</b> Zidane was brilliant, Portugal bent but didn't break until an unlucky hand ball led to the game winning penalty.</p>\n<p>Tomorrow is Holland and Italy. <i>The Dave Winer matchup?</i></p>\n<p><b>Work link</b> <a href=\"http://www.mysql.com/news/article-23.html\">MySQL goes GPL</a> \"To further establish MySQL as the standard open source database we have formed strategic alliances with both VA Linux and Progress Software.\"</p>\n<p><b>We celebrated</b> Christopher's half-birthday yesterday with a candlelight dinner at home... without candlelight, Christopher's safety. <a href=\"http://shanson.editthispage.com/2000/06/27\">Yesterday's entry</a> was intended as a letter to be sent to friends and relatives who may not read our web site. The article isn't really finished yet, though... it's missing a good closing.</p>",fields:{title:"Wednesday",date:"28 Jun 2000",url:"https://papascott.de/2000-06-28-wednesday/"}}},pathContext:{slug:"/2000-06-28-wednesday/",prev:{fields:{title:"What Christopher Has Taught His Parents in 6 Months",date:"27 Jun 2000",slug:"/2000-06-27-what-christopher-has-taught-his-parents-in-6-months/"}},next:{fields:{title:"Mit dem Zweiten sieht man besser",date:"29 Jun 2000",slug:"/2000-06-29-mit-dem-zweiten-sieht-man-besser/"}}}}}});
